// src/components/CarHighlights.js
function CarHighlights() {
    return (
      <section id="cars" className="py-16 bg-lightGray">
        <h3 className="text-3xl font-bold text-neutralBlack text-center mb-10">Destaques de Carros</h3>
        <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-8 max-w-5xl mx-auto px-4">
          <div className="bg-neutralWhite p-6 rounded-lg shadow-md hover:shadow-lg transition-shadow duration-300">
            <h4 className="text-xl font-bold text-darkGray">Modelo 1</h4>
            <p className="text-mediumGray">Descrição breve do carro.</p>
          </div>
          <div className="bg-neutralWhite p-6 rounded-lg shadow-md hover:shadow-lg transition-shadow duration-300">
            <h4 className="text-xl font-bold text-darkGray">Modelo 2</h4>
            <p className="text-mediumGray">Descrição breve do carro.</p>
          </div>
          <div className="bg-neutralWhite p-6 rounded-lg shadow-md hover:shadow-lg transition-shadow duration-300">
            <h4 className="text-xl font-bold text-darkGray">Modelo 3</h4>
            <p className="text-mediumGray">Descrição breve do carro.</p>
          </div>
        </div>
      </section>
    );
  }

  export default CarHighlights;
